package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNull;
import org.junit.jupiter.api.Test;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Sets a valid birth date and verifies it via getBirthDate")
	void testSetBirthDateHappyPath() {
		instance.setBirthDate(LocalDate.of(2020, 1, 1));
	}

	@Test
	@DisplayName("Sets birth date to null and verifies it via getBirthDate")
	void testSetBirthDateNullValue() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Sets a future birth date and verifies it via getBirthDate")
	void testSetBirthDateFutureDate() {
		instance.setBirthDate(LocalDate.of(2025, 12, 31));
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the LocalDate that was set on the Pet object.")
	void testGetBirthDateReturnsSetDate() {
		instance.setBirthDate(LocalDate.of(2020, 1, 1));
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2020, 1, 1), result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns null if birthDate field was not set (default state).")
	void testGetBirthDateReturnsNullWhenNotSet() {
		var result = instance.getBirthDate();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate correctly handles and returns a future LocalDate.")
	void testGetBirthDateWithFutureDate() {
		Pet instance = new Pet();
		instance.setBirthDate(LocalDate.of(2050, 12, 31));
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2050, 12, 31), result);
	}

	@Test
	@DisplayName("Verifies that getType returns null if no PetType has been set on the Pet instance")
	void testGetTypeReturnsNullWhenNotSet() {
		var result = instance.getType();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns the PetType instance that was previously set via setType")
	void testGetTypeReturnsSetType() {
		PetType petType = new PetType();
		petType.setName("Dog");
		instance.setType(petType);
		var result = instance.getType();
		assertNotNull(result);
		assertEquals("Dog", result.getName());
	}

	@Test
	@DisplayName("Verify that setType correctly assigns a valid PetType object to the pet's type field")
	void testSetTypeWithValidPetType() {
		instance.setType(new PetType());
	}

	@Test
	@DisplayName("Verify that setType accepts a null value and assigns it to the type field without error")
	void testSetTypeWithNullValue() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verify that getVisits returns a collection containing the added visit")
	void testGetVisitsWithAddedVisit() {
		Pet pet = new Pet();
		Visit visit = new Visit();
		visit.setDescription("Annual checkup");
		pet.addVisit(visit);
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getVisits returns an empty collection when no visits have been added")
	void testGetVisitsWhenEmpty() {
		Pet pet = new Pet();
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getVisits returns the same collection instance on multiple calls")
	void testGetVisitsReturnsSameCollection() {
		Pet pet = new Pet();
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that a valid visit is added to the pet's visits list")
	void testAddVisitAddsToVisitsList() {
		instance.addVisit(new Visit());
	}

	@Test
	@DisplayName("Verifies that a null visit is added to the pet's visits list without throwing an exception")
	void testAddVisitAddsNullToVisitsList() {
		instance.addVisit(null);
	}

}
